      collect.innerHTML+="[b]Genre:[/b] " +x.Genre+ "\n";
      const xLanguage = x.Language.split(',')[0];
      collect.innerHTML+="[b]Language:[/b] " +xLanguage+ "\n";
      const xCountry = x.Country.split(',')[0];
      collect.innerHTML+="[b]Country:[/b] " +xCountry+ "\n";
